                        "Базовый уровень знаний по вопросам ТБ предусматривает самую необходимую информацию о туберкулёзе, которой желательно владеть каждому человеку в интересах собственного здоровья и здоровья своих близких.": "Sil kasalliklari bo’yicha bazoviy bilim darajasi-bu sil kasalligi xaqida umumiy ma’lumotlarga ega bo’lishni nazarda tutadi, har bir odam o’zining va o’z yaqinlarining salomatligi uchun ham ushbu ma’lumotlarga ega bo’lishi maqsadga muvofiqdir.",
